- input: "TEXT\x1CC00044842\x1C1\x1C\x1CF3XA\x1CNo expenditure was made on behalf
    of a specifically identified federal candidate, and no expenditure was for a public
    communication that referred to a clearly identified candidate for Federal office
    and that promoted, supported, attacked or opposed any such candidate for Federal
    office. No expenditure was for a public communication or voter drive activity
    containing express advocacy or that referred to a clearly identified candidate
    for Federal office and that promoted, supported, attacked or opposed any such
    candidate for Federal office. No employee spent more than 25% of compensated time
    during any month with the reporting period engaged in Federal Election Activity.
    Payments for salaries and related fringe benefits disclosed on Schedule H4 are
    for employees who spent less than 25% of their time engaged in activities in connection
    to any federal election. Disclosure of the contribution from the National Rifle
    Association Political Victory Fund has been amended to clarify that it is from
    a federal PAC and not a corporation. The transfers to the committee's non-federal
    account were primarily for cash needs for non-federal activity. Specifically,
    of the $410,210.66 transfers, there were two transfers totaling $400,000.00 that
    were made to fund non-federal activity related to off-year elections in the state.
    None of those funds were to reimburse shared allocable expenses or fund any activity
    related to a federal election. The remaining amount of $10,210.66 represents the
    correction of an error by an employee in the beginning implementation of joint
    activity reporting and transfers. As the record reflects, the committee began
    to allocate eligible expenses for the first time during this reporting period.
    An employee incorrectly interpreted the process and these transfers correct that
    error. The committee arranged for on-site training of the personnel regarding
    these and all compliance matters to ensure continued and correct compliance.\n"
